import './App.css';
import Intro from './components/Intro/Intro';
import Projects from './components/Projects/Projects';
import Welcome from './components/Welcome/Welcome';
import Contact from './components/Contact/Contact';

function App() {
  return (
    <div className="App">
      <Intro />
      <Welcome />
      <div style="height: 150px; overflow: hidden;" ><svg viewBox="0 0 500 150" preserveAspectRatio="none" style="height: 100%; width: 100%;"><path d="M0.00,49.98 C131.49,10.36 220.08,225.48 500.00,49.98 L500.00,150.00 L-28.78,187.00 Z" style="stroke: none; fill: #08f;"></path></svg></div>
      <Projects />
      <Contact />
    </div>
  );
}

export default App;
